import { Grid, GridItem } from "@chakra-ui/react";

function App() {
  return (
    <Grid
      templateAreas={{
        base: `"nav" "main`,
        lg: `"nav nav" "aside main"`,
      }}
    >
      <GridItem area="nav" color="red">
        Navbar
      </GridItem>
      <GridItem area="aside" color="yellowgreen">
        Aside
      </GridItem>
      <GridItem area="main" color="blue">
        Main
      </GridItem>
    </Grid>
  );
}

export default App;
